  UserCourses.fromJson(dynamic json) {
    message = json["message"];
    if (json["allUserCourses"] != null) {
      allUserCourses = [];
      json["allUserCourses"].forEach((v) {
        allUserCourses.add(AllUserCourses.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
